            Password : "Xloop@123,      ",
            To : 'afnanyousuf@gmail.com',
            From : "you@isp.com",
            Subject : "This is the subject",
            Body : "And this is the body"
        }).then(
          message => alert(message)
        );
    }

  return (
    <>
    <div>ForgetPassword</div>
    <input type="button" onClick={sendEmail} />
    </>
  )
}

